function initContactForm() {
    $('#contactForm').on('submit', function(e) {
        e.preventDefault();

        const form = $(this);
        const formData = {
            name: $('#name').val(),
            email: $('#email').val(),
            subject: $('#subject').val(),
            message: $('#message').val()
        };

        // Validate form
        if (!validateContactForm(formData)) {
            return;
        }

        // Show loading state
        const submitBtn = form.find('button[type="submit"]');
        const originalText = submitBtn.html();
        submitBtn.prop('disabled', true).html('<i class="bi bi-hourglass-split me-2"></i>Sending...');

        // Send form via AJAX to Formspree
        $.ajax({
            url: 'https://formspree.io/f/mdkdgrnj',
            method: 'POST',
            data: form.serialize(),
            dataType: 'json',
            success: function() {
                showNotification('success', 'Message sent successfully! We\'ll get back to you soon.');
                form[0].reset();
            },
            error: function() {
                showNotification('error', 'Oops! Something went wrong. Please try again later.');
            },
            complete: function() {
                // Reset button
                submitBtn.prop('disabled', false).html(originalText);

                // Track form submission
                trackEvent('contact_form_submit', {
                    user_email: formData.email
                });
            }
        });
    });
}


    // Validate contact form
    function validateContactForm(data) {
        let isValid = true;
        
        // Clear previous errors
        $('.form-control').removeClass('is-invalid');
        $('.invalid-feedback').remove();
        
        // Validate name
        if (!data.name.trim()) {
            $('#name').addClass('is-invalid');
            $('#name').after('<div class="invalid-feedback">Please enter your name.</div>');
            isValid = false;
        }
        
        // Validate email
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        if (!data.email.trim() || !emailRegex.test(data.email)) {
            $('#email').addClass('is-invalid');
            $('#email').after('<div class="invalid-feedback">Please enter a valid email address.</div>');
            isValid = false;
        }
        
        // Validate subject
        if (!data.subject.trim()) {
            $('#subject').addClass('is-invalid');
            $('#subject').after('<div class="invalid-feedback">Please enter a subject.</div>');
            isValid = false;
        }
        
        // Validate message
        if (!data.message.trim() || data.message.trim().length < 10) {
            $('#message').addClass('is-invalid');
            $('#message').after('<div class="invalid-feedback">Please enter a message (at least 10 characters).</div>');
            isValid = false;
        }
        
        return isValid;
    }

